function App(){

return ( 
<div>
    <Header/>
    {notes.map((notes=>{
        return ( <Note 
        key={notes.id}
        title={notes.title}
        content={notes.content}
    />);
    }))
    }
    <Footer/>
</div>
);
}

export default App;
